import {useEffect, useState} from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
function Userinfo(props){
    let { id } = useParams()
    const [pro,setpro] =useState()
    useEffect(async ()=>{
        axios.get('http://localhost:5001/u/user/YogiCool')
            .then( res =>{
                //console.log(res);
                setpro(res.data);
            })
            .catch( err =>{
                console.log(err);
            })
    })
    return (
        <>
            <div>
                <h1>{pro.username}</h1>
                <p>{pro.Description}</p>
            </div>
        </>
    )
}
export default Userinfo
